schemaDefinition: "create or replace view X_SNC_IMPLMNTATION_IMPLEMENTATIONAPPPRODUCTS(\n\
  \t\"ImplAppSysID\",\n\t\"ImplAppImplementationSysID\",\n\t\"ImplAppApplicationSysID\"\
  ,\n\t\"ImplAppImplementationStatus\",\n\t\"ImplAppSysUpdatedOn\",\n\t\"ImplAppNumber\"\
  ,\n\t\"ImplAppStatus\",\n\t\"ImplAppGoLiveDate\",\n\t\"ImplAppStartDate\",\n\t\"\
  ImplAppSysUpdatedBy\",\n\t\"ImplAppSysCreatedOn\",\n\t\"ImplAppImplmenter\",\n\t\
  \"ImplAppStage\",\n\t\"ImplAppLead\",\n\t\"ImplAppApplication\",\n\t\"ImplAppImplStage\"\
  ,\n\t\"ImplAppType\",\n\tIMPLEMENTER_TYPE,\n\tREASON,\n\t\"ImplAppDvImplementation\"\
  ,\n\t\"ImplAppImplementerSysID\"\n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"SYS_ID\"\
  \ as \"ImplAppSysID\",\n       \"IMPLEMENTATION\" as \"ImplAppImplementationSysID\"\
  ,\n       \"APPLICATION\" as \"ImplAppApplicationSysID\",\n       \"DV_IMPLEMENTATION_STATUS\"\
  \ as \"ImplAppImplementationStatus\",\n       \"SYS_UPDATED_ON\" as \"ImplAppSysUpdatedOn\"\
  ,\n       \"NUMBER\" as \"ImplAppNumber\",\n       \"IMPLEMENTATION_STATUS\" as\
  \ \"ImplAppStatus\",\n       \"GO_LIVE_DATE\" as \"ImplAppGoLiveDate\",\n      \
  \ \"START_DATE\" as \"ImplAppStartDate\",\n       \"SYS_UPDATED_BY\" as \"ImplAppSysUpdatedBy\"\
  ,\n       \"SYS_CREATED_ON\" as \"ImplAppSysCreatedOn\",\n       \"DV_IMPLEMENTER\"\
  \ as \"ImplAppImplmenter\",\n       \"DV_IMPLEMENTATION_STAGE\" as \"ImplAppStage\"\
  ,\n       \"IMPLEMENTATION_LEAD\" as \"ImplAppLead\",\n       \"DV_APPLICATION\"\
  \ as \"ImplAppApplication\",\n       \"IMPLEMENTATION_STAGE\" as \"ImplAppImplStage\"\
  ,\n       \"DV_IMPLEMENTER_TYPE\" as \"ImplAppType\",\n       \"IMPLEMENTER_TYPE\"\
  \ as \"IMPLEMENTER_TYPE\",\n       \"REASON\" as \"REASON\",\n       \"DV_IMPLEMENTATION\"\
  \ as \"ImplAppDvImplementation\",\n       \"IMPLEMENTER\" as \"ImplAppImplementerSysID\"\
  \nFROM \"RDS\".\"SURF\".\"X_SNC_IMPLMNTATION_IMPLEMENTATIONAPPPRODUCTS\";"
